// The actual JSON data is embedded inside this string. We need to extract it.
// Let's find the first '{' and the last '}' to get the JSON part.
const startIndex = rawInputString.indexOf('{');
const endIndex = rawInputString.lastIndexOf('}');

// Check if we found a valid JSON object block
if (startIndex === -1 || endIndex === -1) {
  throw new Error("Could not find a JSON object in the input string.");
}

// Extract the clean JSON string from between the braces
const jsonString = rawInputString.substring(startIndex, endIndex + 1);

try {
  // Now, parse the clean JSON string
  const data = JSON.parse(jsonString);

  // The URLs are in an array under the 'websites' key
  const websites = data.websites;

  // Return a new item for each website. This is the standard
  // way to process lists, allowing subsequent nodes to run
  // for each individual URL.
  return websites.map(url => {
    return {
