// Input: HTML string in $input.first().json.data
const input = ($input.first().json.data || "").toString();

// Helper to dedupe & clean
const uniq = arr => Array.from(new Set((arr || []).map(s => (s||"").trim()).filter(Boolean)));

// 1) Emails (exclude image file extensions)
const emailRegex = /[a-zA-Z0-9._%+-]+@[a-zA-Z0-9.-]+\.(?!(png|jpg|jpeg|gif|webp|svg|bmp|ico))[a-zA-Z]{2,}/gi;
let emails = input.match(emailRegex) || [];

// Also capture mailto: links that may contain query params
const mailtoRegex = /mailto:([^\?"'>\s]+)/gi;
let m;
while ((m = mailtoRegex.exec(input)) !== null) {
  const e = m[1].replace(/%40/g, "@");
  if (e) emails.push(e);
}
emails = uniq(emails);

// 2) Phones (US-centric common patterns, optional +1)
const phoneRegex = /(?:\+?1[\s.\-()]*)?(?:\(\s*\d{3}\s*\)|\d{3})[\s.\-()]*\d{3}[\s.\-()]*\d{4}/g;
let phones = input.match(phoneRegex) || [];
phones = uniq(phones);

// Normalize phones (optional): remove excessive spaces, keep formatting as found
// If you want normalized digits only, uncomment next line
// phones = phones.map(p => p.replace(/[^\d+]/g, ""));

// 3) Name extraction: try meta og:site_name -> meta[name="title"] -> <title> -> first <h1> -> img alt
let name = null;

const extractFirst = (regex) => {
  const r = regex.exec(input);
  return r && r[1] ? r[1].replace(/\s+/g, " ").trim() : null;
};

// og:site_name
