// meta name="title" or meta property="title"
name = name || extractFirst(/<meta[^>]*name=["']title["'][^>]*content=["']([^"']+)["'][^>]*>/i);
name = name || extractFirst(/<meta[^>]*property=["']title["'][^>]*content=["']([^"']+)["'][^>]*>/i);
// <title>
name = name || extractFirst(/<title[^>]*>([^<]+)<\/title>/i);
// first h1
name = name || extractFirst(/<h1[^>]*>([\s\S]*?)<\/h1>/i);
// logo alt or img with class including logo
name = name || extractFirst(/<img[^>]*(?:alt|title)=["']([^"']+)["'][^>]*class=["'][^"']*logo[^"']*["'][^>]*>/i);
name = name || extractFirst(/<img[^>]*alt=["']([^"']+)["'][^>]*>/i);

// final sanitize: remove HTML tags if any
if (name) {
  name = name.replace(/<[^>]+>/g, "").replace(/\s{2,}/g, " ").trim();
}

// Build output ensuring keys exist and nulls used where not found
const result = {
  email: emails.length ? emails[0] : null,
  emails: emails.length ? emails : null,
  phone: phones.length ? phones[0] : null,
  phones: phones.length ? phones : null,
  name: name || null
};

return [{ json: result }];

